body:
I have a contract that receives ETH and a proxy contract that is designed  to receive ETH from exchange wallets and other managed wallets.

Sending ETH directly to TokenSales.address succeeds but sending ETH to Proxy.address fails with OOG

It seems like the amount of gas sent on the send call is very small which causes this to fail.  

```
contract TokenSales is TokenSalesInterface {
  function () returns (bool success) {
    uint256 _amount = msg.value;
    address _sender;
    if (proxies[msg.sender].isProxy == true) {
      _sender = proxies[msg.sender].payout;
    } else {
      _sender = msg.sender;
    }
    return purchase(_sender, _amount);
  }
}
```

```
contract Proxy {

  address public owner;
  address public crowdsale;
  address public payout; 

  function Proxy(address _owner, address _crowdsale, address _payout) {
    owner = _owner;
    crowdsale = _crowdsale;
    payout = _payout;
    if (!TokenSalesInterface(_crowdsale).regProxy(_payout)) throw;
  }

  function () {
    uint256 _val = msg.value;
    if (sendEther(_val) == false) throw;
  }

  function sendEther(uint256 _amount) returns (bool success) {
    return (crowdsale).send(_amount);
  }
}
```
